import React from "react";
import "./Footer.css";
import "./HorizontalneListe.css";
import HorizontalnaLista from "./HorizontalneListe";
import Ikona from "./Ikonica.js";
import "./Ikonica.css";
import img from "./10-kitty-litter-leded.w700.h700.jpg";
function Footer(){
    return(
        
            <footer>
                <div id="tekst">
                    <HorizontalnaLista prvi="ABOUT" drugi="TEAM" treci="CONTACT"/>
                </div>
                <div id="ikone">
                    <HorizontalnaLista prvi="csd" drugi="njfnd"/>
                </div>
            </footer>
       
    );
}

export default Footer;
